
import base64
import hashlib
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def decrypt(encdata, masterkey, salt, iv):
    key = hashlib.pbkdf2_hmac('sha512', masterkey, base64.b64decode(salt), 100000, 32)
    cipher = AES.new(key, AES.MODE_CBC, base64.b64decode(iv))
    decrypted = unpad(cipher.decrypt(base64.b64decode(encdata)), AES.block_size)
    return decrypted.decode()

