encryptionKey = hashlib.sha256("d1267c76c22283e25329c6c19fe4c6097ea33486347b5c422a35f129f075f8db".encode()).digest()[:32]

decrypted_runnerCode = decrypt(encryptedData, encryptionKey, salt, iv)
